            Clipboard?.Copy(Value);
            Message.Show($"恭喜您复制成功！", "RootMessage", MessageType.Zoom);
        }

        protected async override void Loaded()
        { 
            Items = await Task.Run(() =>
            {
                Items = new Dictionary<string, string>();
                foreach (var item in JsonConvert.DeserializeObject<List<string>>(iconJson))
                {
                    Items.Add(LayFontsHelper.StringToUnicode(item), item);
                }
                return Items;
            }); 
        }

